export default (function(a,b,c,d,e,f,g,h,i){return {data:{uPY2dBJSS5:{data:{id:1582,attributes:{imdbId:"tt0118229",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BODgwODg1NGYtMWYxNS00OGUzLThlNzItOWIwODM0NmU0NWRiXkEyXkFqcGdeQXVyMjQ1MjYzOTQ@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"5.6\u002F10"},{Source:"Rotten Tomatoes",Value:"50%"}],item_lang:{data:{id:2245,attributes:{title:"Illtown",plot:"Dante and his girlifrend Micky run a very profitable drug operation in a seaside town, aided and abetted by a host of teens who sell the smack at discos around town, as well as by Lucas, a corrupt cop who's on the take. Their downfall comes when they suspect one of the boys, Pep, of ripping them off, and his accidental death causes disloyalty among the teens, who suspect Dante offed them. All of this is perfect for the return of Gabriel, a one-time partner of Dante, who has just been released from jail, and has an almost angelic demeanor and the certainty that he can fix everyone's lives.",slug:"illtown"}}},books:{data:[{id:8273,attributes:{title:b,description:d,thumbnail:e,authors:[f],firstBook:true,published:g,publisher:h,subtitle:i}},{id:8274,attributes:{title:b,description:d,thumbnail:e,authors:[f],firstBook:a,published:g,publisher:h,subtitle:i}},{id:8275,attributes:{title:"Vice Slang",description:"Are you a bit of a chairwarmer? Do you use the wins from a country straight to get scudded on snakebite in a blind tiger? Do you ride the waves on puddle or death drop? Vice Slang gently eases you into the language of gambling, drugs and alcohol, providing you with 3,000 words to establish yourself firmly in the world of corruption and wickedness. All words are illustrated by a reference from a variety of sources to prove their existence in alleys and dives throughout the English speaking world. This entertaining book will give you hours of reading pleasure.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=qZ1-AgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Tom Dalzell","Terry Victor"],firstBook:a,published:"2007-10-31",publisher:"Routledge",subtitle:c}},{id:8276,attributes:{title:"The Uptown Kids",description:"Teenagers from Harlem share their thoughts, dreams, and experiences in an exploration of how adversity and anger are transformed into culture",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=VVNHAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Terry Moses Williams","William Kornblum"],firstBook:a,published:"1994-01-01",publisher:"Putnam Adult",subtitle:"Struggle and Hope in the Projects"}},{id:8277,attributes:{title:b,description:"Terry Williams is a sociologists, and since 1982 he has spend months mixing with the New York teenage drug ring in cocaine bars, clubs, discos, crack houses, street corners and family parties. In this book he describes the lives of eight young cocaine dealers. He looks at their daily routines, the places they meet, sell and rap, and the stresses and dangers of their private lives.",thumbnail:c,authors:["Terry Williams"],firstBook:a,published:"1989-01-01",publisher:c,subtitle:"The Inside Story of a Teenage Drug Ring"}}]}}},meta:{}}},prerenderedAt:1680940970179}}(null,"The Cocaine Kids","","Since 1982, sociologist Terry Williams has spent days, weeks, and months “hanging out” with a teenage cocaine ring in cocaine bars, after-hours clubs, on street corners, in crack houses and in their homes. The picture he creates in The Cocaine Kids is the story behind the headlines. The lives of these young dealers in the fast lane of the underground economy emerge in depth and color on the pages of this book.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=rWhKDgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","Terry Tempest Williams","1990-01-22","Hachette UK","The Inside Story Of A Teenage Drug Ring"))